import Container from 'react-bootstrap/Container';
import Button from 'react-bootstrap/Button';

function NavMenu() {
    return (
      <Container className="d-flex align-items-center py-8 p-0">
        <img src="/images/actual-logo.png" alt="Site Logo" width="232" />
        <div className="d-flex flex-grow-1 ms-0">
          <Button variant="outline-success" size="lg" className="w-50 py-5 mb-0 button-text no-round">
            CODING
          </Button>
          <Button variant="outline-info" size="lg" className="w-50 py-4 mb-0 button-text no-round">
            COMICS
          </Button>
        </div>
      </Container>
    );
  }
  
  export default NavMenu;
